import React from "react";

const DashboardAdmin = () => {
  const employees = [
    { id: 1, firstName: "John Doe" },
    { id: 2, Lastnname: "Jane Smith" },
    // Add more employees here
  ];

  const clients = [
    { id: 1, name: "Client A" },
    { id: 2, name: "Client B" },
    // Add more clients here
  ];

  return (

    <>
        <h1 className="text-black text-2xl text-center font-bold mb-4">Dashboard Admin</h1>
        <p className="text-black text-center">Vous êtes connecté en tant qu'administrateur</p>
        <div className="flex justify-center h-screen">
            <div className="grid grid-cols-2 gap-11 mt-11 border">
                <div>
                    <h2 className="text-black text-xl font-bold mb-4 border">
                        Liste des employés :
                    </h2>
                    <ul className="text-black">
                        {employees.map((employee) => (
                            <li key={employee.id}>
                                {employee.firstname}, {employee.lastName}, {employee.address}
                            </li>
                        ))}
                    </ul>
                </div>
                <div>
                    <h2 className="text-black text-xl mb-4 font-bold border">Liste des clients:</h2>
                    <ul className="text-black">
                        {clients.map((client) => (
                            <li key={client.id}>{client.name}</li>
                        ))}
                    </ul>
                </div>
            </div>
        </div>
    </>
  );
};

export default DashboardAdmin;
